import * as React from "react";

function SvgComp(props) {
  return <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 10 10" {...props}><path fill="#EC2127" d="M0 10V0h10z" /></svg>;
}
        export const svgString = '<svg xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink"	 viewBox="0 0 10 10" xml:space="preserve"><polygon  fill="#EC2127" points="0,10 0,0 10,0 "/></svg>';
        export const SvgComponent = React.memo(SvgComp);
